import "./Header.css";
import Tittle from './tittle/Tittle';
import bgHeader from "../../assets/bg-header.jpg";

function Header() {
	return (
		<div>
			<div className="header ">

			im
				<div className=" about text-white m-4">

				<h3 classNameName="lema">Districarnes</h3>
					<h5 classNameName="tittle"><Tittle/></h5>
					<p>
					Tenemos el privilegio de cuidar nuestro producto desde su origen, obteniendo 
					una carne saludable de magnifico sabor.
					</p>

					<h3 classNameName="lema">Calidad y buen Servicio</h3>
				</div>
			</div>
		</div>
	);
}
export default Header;
